        <>
            <select
                className="select"
                value={selectValue} onChange={(e) => setSelect({ currency: e.target.value })}>
                {selectArray.map(item => {
                    return <option key={item.cc}>{item.cc}</option>
                })}
            </select>

        </>
    )
}
